import React from "react";
import "./meet.css"; // External CSS for styles
import PlaceholderImage from "./images/image.png"; // Ensure this image exists

const VideoCallUI = () => {
  return (
    <div className="video-call-container">
      {/* Background and Main UI */}
      <div className="video-background"></div>
      <div className="video-call-box"></div>

      {/* User Profile */}
      <div className="user-profile">
        <div className="profile-icon"></div>
        <p className="username">UserXYZ</p>
      </div>

      {/* Bottom Action Buttons */}
      <div className="call-controls">
        <div className="control-btn mute"></div>
        <div className="control-btn video-off"></div>
        <div className="control-btn raise-hand"></div>
        <div className="control-btn options"></div>
        <div className="control-btn end-call"></div>
      </div>

      {/* Right Sidebar */}
      <div className="right-sidebar">
        <p className="in-call-message">In-call message</p>
        <div className="send-message-box">
          <p>Send a message to everyone</p>
        </div>
      </div>
    </div>
  );
};

export default VideoCallUI;
